import React, {useState} from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import { Link as Links } from "react-router-dom";
import clsx from 'clsx';
import IconButton from '@material-ui/core/IconButton';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';
import Visibility from '@material-ui/icons/Visibility';
import VisibilityOff from '@material-ui/icons/VisibilityOff';

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright Â© '}
      <Link color="inherit" href="https://material-ui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles(theme => ({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(3),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));

export default function EditProfile() {
  const classes = useStyles();

  let [setFirstnameRegVar] = useState('');
  let [setMiddlenameRegVar] = useState('');
  let [setLastnameRegVar] = useState('');
  let [setBirthdayRegVar] = useState('');
  let [setMobileRegVar] = useState('');
  let [setEmailRegVar] = useState('');
  let [setPasswordRegVar] = useState('');


  function setFirstnameReg(e) {
    setFirstnameRegVar = e.target.value;
  }

  function setMiddlenameReg(e) {
    setMiddlenameRegVar = e.target.value;
  }

  function setLastnameReg(e) {
    setLastnameRegVar = e.target.value;
  }

  function setBirthdayReg(e) {
    setBirthdayRegVar = e.target.value;
  }

  function setMobileReg(e) {
    setMobileRegVar = e.target.value;
  }

  function setEmailReg(e) {
    setEmailRegVar = e.target.value;
  }

  function setPasswordReg(e) {
    setPasswordRegVar = e.target.value;
  }

  const [values, setValues] = useState({
    passord: '',
    showPassword: false,
  });

  function setAddressReg(e) {
    setEmailRegVar = e.target.value;
  }

  function setAddress2Reg(e) {
    setEmailRegVar = e.target.value;
  }

  function setZipReg(e) {
    setEmailRegVar = e.target.value;
  }

  function setEmailReg(e) {
    setEmailRegVar = e.target.value;
  }


  const handleClickShowPassword = () => {
    setValues({ ...values, showPassword: !values.showPassword });
  };

  const handleMouseDownPassword = event => {
    event.preventDefault();
  };

  return (
    <Container component="main" maxWidth="xs">
      <CssBaseline />
      <div className={classes.paper}>
        <Avatar className={classes.avatar}>
          <LockOutlinedIcon />
        </Avatar>
        <Typography component="h1" variant="h5">
          Sign up
        </Typography>
        <form className={classes.form} noValidate>
          <Grid container spacing={2}>
            <Grid item xs={12} sm={6}>
              <TextField
                name="firstname"
                autoComplete="firstname"
                variant="outlined"
                required
                fullWidth
                id="firstname"
                label="Fornavn"
                autoFocus
                onChange={setFirstnameReg}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                name="middlename"
                autoComplete="middlename"
                variant="outlined"
                required
                fullWidth
                id="middlename"
                label="Mellomnavn"
                autoFocus
                onChange={setMiddlenameReg}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                name="lastname"
                variant="outlined"
                required
                fullWidth
                id="lastname"
                label="Etternavn"
                onChange={setLastnameReg}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                name="mobile"
                variant="outlined"
                fullWidth
                id="mobile"
                label="Telefon (valgfri)"
                onChange={setMobileReg}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                name="birthday"
                variant="outlined"
                required
                fullWidth
                id="birthday"
                type="date"
                onChange={setBirthdayReg}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                name="email"
                variant="outlined"
                required
                fullWidth
                id="email"
                label="Epost"
                onChange={setEmailReg}

              />
            </Grid>
            <Grid item xs={12}>
              <FormControl className={clsx(classes.margin, classes.textField)} variant="outlined" fullWidth>
                <InputLabel htmlFor="outlined-adornment-password" required>Passord</InputLabel>
                <OutlinedInput
                  name="confirmPassword"
                  id="outlined-adornment-password"
                  type={values.showPassword ? 'text' : 'password'}
                  onChange={setPasswordReg}
                  endAdornment={
                    <InputAdornment position="end">
                      <IconButton
                        aria-label="toggle password visibility"
                        onClick={handleClickShowPassword}
                        onMouseDown={handleMouseDownPassword}
                        edge="end"
                      >
                        {values.showPassword ? <Visibility /> : <VisibilityOff />}
                      </IconButton>
                    </InputAdornment>

                  }
                  labelWidth={70}
                />
              </FormControl>
            </Grid>
            <Grid item xs={12}>
              <FormControlLabel
                control={<Checkbox value="allowExtraEmails" color="primary" />}
                label="Jeg Ã¸nsker Ã¥ motta nyheter pÃ¥ mail"
              />
            </Grid>
          </Grid>
          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            className={classes.submit}
          >Opprett konto
                    </Button>
          <Grid container justify="flex-end">
            <Grid item>
            </Grid>
          </Grid>
        </form>
      </div>
      <Box mt={5}>
        <Copyright />
      </Box>
    </Container>
  );
}
